import React from "react";
import { Link } from "react-router-dom";

const EventDetails = ({ event }) => {
  return (
    <div>
      <h3>{event.id}</h3>
      <Link to="/" className="btn btn-primary">
        Sair
      </Link>
    </div>
  );
};

export default EventDetails;
